import { Dimensions } from 'react-native'

export default {
  cardContainer: {
    flex: 1,
  },
  container: {
    flex: 1,
  },
  headerContainer: {

    backgroundColor: '#FFF',
    marginBottom: 5,
    marginTop: 5,
    flex: 1,
    flexDirection: 'row',
    flexWrap: 'wrap',
    alignItems: 'center'
  },
  indicatorTab: {
    backgroundColor: 'transparent',
  },
  scroll: {
    backgroundColor: '#FFF',
  },
  sceneContainer: {
    marginTop: 10,
  },
  socialIcon: {
    marginLeft: 14,
    marginRight: 14,
  },
  item: {
    width: '30%' // is 50% of container width
  },
  item2: {
    width: '70%' // is 50% of container width
  },
  socialRow: {
    flexDirection: 'row',
  },
  tabBar: {
    backgroundColor: '#EEE',
  },
  masonryContainer: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    justifyContent: 'space-between',
    marginLeft: 0,
    marginRight: 0,
  },
  tabContainer: {
    flex: 1,
    marginBottom: 12,
  },
  tabLabelNumber: {
    color: 'gray',
    fontSize: 12.5,
    textAlign: 'center',
  },
  tabLabelText: {
    color: 'black',
    fontSize: 22.5,
    fontWeight: '600',
    textAlign: 'center',
  },
  userBioRow: {
    marginLeft: 2,
    marginRight: 40,
  },
  userBioText: {
    color: 'gray',
    fontSize: 12
  },
  userImage: {
    borderRadius: 60,
    height: 90,
    marginBottom: 10,
    width: 90,
  },
  userNameRow: {
    marginBottom: 2,
  },
  userNameText: {
    color: '#5B5A5A',
    fontSize: 14,
    fontWeight: 'bold',
    textAlign: 'center',
  },
  userRow: {
    alignItems:'flex-start',
    flexDirection: 'column',
    justifyContent: 'center',
    marginBottom: 12,
  },
}
